import React from "react";
import './Estilos/Cover.css';
import './Estilos/First_sentence.css';

function Home() {
    return (
        <div className="Cover">
        <h className='First_sentence'>
            "Nobody is better than other <br/>
                in terms of music"
        </h>
        </div>
    );
}

export default Home;
